import React from "react";
import "./LoginComponentStyles.css"
import {
    Button,
    FilledInput,
    FormControl,
    IconButton,
    InputAdornment,
    InputLabel,
    OutlinedInput,
    TextField
} from "@material-ui/core";
import {GithubLoginButton, GoogleLoginButton} from "react-social-login-buttons";
import Visibility from "@material-ui/icons/Visibility";
import VisibilityOff from "@material-ui/icons/VisibilityOff";

interface State {
    login: string;
    password: string;
    showPassword: boolean;
}

export default function LoginComponent() {
    const [state, setState] = React.useState<State>({
       login: '',
       password: '',
        showPassword: false,
    });

    const handleLoginButton = () => {
        console.log(state.login + " " + state.password)
    }

    const handleChange = (prop: keyof State) => (
        event: React.ChangeEvent<HTMLInputElement>
    ) => {
        setState({ ...state, [prop]: event.target.value });

    };

    const handleClickShowPassword = () => {
        setState({ ...state, showPassword: !state.showPassword });
    };

    // const handleGoogle = () => {
    //     console.log("google")
    // }
    //
    // const handleGit = () => {
    //     console.log("git")
    // }
    const oauthLogin = (url) => {
        // window.location.assign("https://sklep-backend.azurewebsites.net" + url);
        window.location.assign("http://localhost:9000" + url);
    };

    return (
        <div className="page">
            <div className="container">
                <div className='text'>ZALOGUJ SIĘ</div>
                <div className="text-fields">
                    <TextField className="text-field" value={state.login} onChange={handleChange("login")} id="outlined-basic" label="Login" variant="outlined" />
                    <FormControl variant="outlined">
                        <InputLabel htmlFor="outlined-adornment-password">Hasło</InputLabel>
                        <OutlinedInput
                        className="text-field"
                        id="outlined-adornment-password"
                        type={state.showPassword ? 'text' : 'password'}
                        value={state.password}
                        onChange={handleChange('password')}
                        endAdornment={
                            <InputAdornment position="end">
                                <IconButton
                                    aria-label="toggle password visibility"
                                    onClick={handleClickShowPassword}
                                    edge="end"
                                >
                                    {state.showPassword ? <Visibility /> : <VisibilityOff />}
                                </IconButton>
                            </InputAdornment>
                        }
                    />
                    </FormControl>
                </div>

                <div className="social-container">
                    <Button className="login-button" variant="contained" onClick={handleLoginButton}>ZALOGUJ SIĘ</Button>
                    <GoogleLoginButton style={{ width: "35vw" }} onClick={() => oauthLogin("/authenticate/github")}> <span>Zaloguj przez Gmaila</span></GoogleLoginButton>
                    <GithubLoginButton style={{ width: "35vw" }} onClick={handleGit}> <span>Zaloguj przez GitHuba</span></GithubLoginButton>

                </div>
            </div>

        </div>
    )
}
